package swa.db.entity;import java.io.Serializable;import java.util.Date;/** * Job:任务表 * Created by jinyan.cao on 2017-10-23 18:43:09 */public class JobInfo implements Serializable {    private static final long serialVersionUID = 1L;    /**     * 自增主键     */    private Long id;    /**     * 任务名     */    private String jobName;    /**     * 应用名     */    private String appName;    /**     * 类名     */    private String beanName;    /**     * 方法名     */    private String methodName;    /**     * 参数     */    private String cronParam;    /**     * 调度地址     */    private String scheduleAddr;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getJobName() {        return this.jobName;    }    public void setJobName(String jobName) {        this.jobName = jobName;    }    public String getAppName() {        return this.appName;    }    public void setAppName(String appName) {        this.appName = appName;    }    public String getBeanName() {        return this.beanName;    }    public void setBeanName(String beanName) {        this.beanName = beanName;    }    public String getMethodName() {        return this.methodName;    }    public void setMethodName(String methodName) {        this.methodName = methodName;    }    public String getCronParam() {        return this.cronParam;    }    public void setCronParam(String cronParam) {        this.cronParam = cronParam;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public String getScheduleAddr() {        return scheduleAddr;    }    public void setScheduleAddr(String scheduleAddr) {        this.scheduleAddr = scheduleAddr;    }}